databaseChangeLog:
  - changeSet:
      id: insert-into-parkingspace
      author: santosh.g@desapex.com
      changes:
        - loadData:
            tableName: parkingspace
            file: classpath:/db/changelog/data/parkingspace.csv
            columns:
              - column:
                  name: id
                  type: BIGINT
              - column:
                  name: parkingspace_floor_id
                  type: BIGINT
              - column:
                  name: name
                  type: varchar(200)
              - column:
                  name: type
                  type: varchar(50)
              - column:
                  name: status
                  type: varchar(50)
